export default getFeature = (bivakzone, i) => {

    if (bivakzone.properties[i] === undefined) {
        return false;
    } else {

        bivakzone.features = bivakzones.features.filter(bivakzones => bivakzones.properties['dog'] === 'yes');
        return bivakzone.features;

    }


}




